import logo from './logo.svg';
import {useState} from "react";
import "./App.scss";

const App = () => {
  const [menuOpen, toggleMenu] = useState(false);
  return (
    <div className="App">
      <header>
        <div id="hamburger">
          <input id="hamburger--toggle" className="hamburger" type="checkbox"
            checked={menuOpen}
            readOnly
            onClick={() => {
              menuOpen? toggleMenu(false): toggleMenu(true);
            }}
          />
          <label htmlFor="hamburger--toggle">
            <div>
              <div className="hamburger layers" />
              <div className="hamburger layers" />
              <div className="hamburger layers" />
            </div>
          </label>
          <div id="menu">
            <ul>
            <li>one</li>
            <li>one</li>
            <li>one</li>
            <li>one</li>
            </ul>
          </div>
        </div>
        <div id="logo">logo</div>
      </header>
    </div>
  );
}

export default App;
